function TIC() -- main loop
	vbank(1) -- foreground mode
	cls()

	player:update()
	draw_keys(areas[game.area].layers[current_layer])

	print("LAYER "..current_layer, 0, 0, 2)
	
	player:render()

	vbank(0) -- background mode
	cls()

	draw_layers(areas[game.area].layers)
end

function enter_new_layer()
	player.collected_keys = {}
	player.keys_left = areas[game.area].layers[current_layer].keys and #areas[game.area].layers[current_layer].keys or 0
end

function enter_new_area()
	game.area = game.area + 1
	current_layer = 1

	player.position.x = 0
	player.position.y = 0
	player.direction.x = 0
	player.state = "Idle"
	player.spr_index = 256
	player.anim = 0
	player.flip = 0
	player.layer_falling_timer = 0

	music(game.area, 0, 0, true, true)
	enter_new_layer()
end

function draw_keys(layer)
	local keys = layer.keys
	if keys and player.layer_falling_timer == 0 then
		for i = 1, #keys do
			if not player.collected_keys[i] then
				spr(320,
					240 / 2 + 8 - player.position.x + layer.pos_offset.x * 16 + keys[i].x * 32 - layer.size.x * 16 - layer.map_offset.x * 32,
					136 / 2 + 8 - player.position.y + layer.pos_offset.y * 16 + keys[i].y * 32 - layer.size.y * 16 - layer.map_offset.y * 32,
					0, 1, 0, 0, 2, 2)
			end
		end
	end
end

function BDR(scanline) -- gradient background
	areas[game.area].draw_bg(scanline)
end

function draw_layers(layers)
	for depth = #layers, current_layer, -1 do
		local layer = layers[depth]
		local ratio
		if depth == current_layer then
			ratio = math.pow(20, -depth + current_layer + math.sin(math.pi * (player.layer_falling_timer + 96) / 64) + 1)
		else
			ratio = math.pow(2, -depth + current_layer + math.sin(math.pi * (player.layer_falling_timer + 96) / 64) + 1)
		end
		
		draw_tiles(
			math.floor(240 / 2 - player.position.x + layer.pos_offset.x * 16),
			math.floor(136 / 2 - player.position.y + layer.pos_offset.y * 16),
			layer.map_offset.x, layer.map_offset.y,
			layer.size.x, layer.size.y,
			ratio
		)
	end
end

function draw_tiles(x, y, from_x_tiles, from_y_tiles, width_tiles, height_tiles, scale)
	local width, height = width_tiles * 32, height_tiles * 32
	local from_x, from_y = from_x_tiles * 32, from_y_tiles * 32

	local u1, v1 = from_x, from_y
	local u2, v2 = width + from_x, from_y
	local u3, v3 = from_x, height + from_y
	local u4, v4 = width + from_x, height + from_y

	-- center should ALWAYS be 240/2, 136/2
	local center = Vector2.new(240//2, 136//2)

	-- to scale them evenly compare the x to the center of the screen
	fuck = Vector2.new(
		(x - width / 2 - center.x),
		(y - height / 2 - center.y)
		
	)

	cuck = Vector2.new(
		-(center.x - x - width / 2),
		-(center.y - y - height / 2)
	)

	local left_edge = math.floor(center.x + fuck.x * scale)
	local right_edge = math.floor(center.x + cuck.x * scale)
	local top_edge = math.floor(center.y + fuck.y * scale)
	local bottom_edge = math.floor(center.y + cuck.y * scale)

	local x1, y1 = left_edge, top_edge
	local x2, y2 = right_edge, top_edge
	local x3, y3 = left_edge, bottom_edge
	local x4, y4 = right_edge, bottom_edge

	ttri(x1, y1, x2, y2, x3, y3, u1, v1, u2, v2, u3, v3, 1, 0)
	ttri(x2, y2, x3, y3, x4, y4, u2, v2, u3, v3, u4, v4, 1, 0)
end

