	position = Vector2.new(),
	direction = Vector2.new(),
	state = "Idle",
	spr_index = 256,
	anim = 0,
	flip = 0,
	size = Vector2.new(24, 32),
	layer_falling_timer = 0, -- make this like 0 - 32 or something
	keys_left = 0,
	collected_keys = {},
	area_transition_timer = 0, -- 32 again probably?
}

game = {
	area = 0 -- tutorial?
}

function player.update(self)
	if self.state == "Idle" then
		local layer = areas[game.area].layers[current_layer]

		local tile_pos = Vector2.new(
			(self.position.x - layer.pos_offset.x * 16 + layer.map_offset.x * 32 + layer.size.x * 16 - 16) // 32,
			(self.position.y - layer.pos_offset.y * 16 + layer.map_offset.y * 32 + layer.size.y * 16 - 16) // 32
		)

		if get_tile(tile_pos.x, tile_pos.y) == "spikes" then
			trace("your die")
			exit()
		end

		if layer.keys then
			for i = 1, #layer.keys do
				if not self.collected_keys[i] and tile_pos.x == layer.keys[i].x and tile_pos.y == layer.keys[i].y then
					self.collected_keys[i] = true
					self.keys_left = self.keys_left - 1
					sfx(62, (12 * 6), -1, 1, 15)
				end
			end
		end

		if get_tile(tile_pos.x, tile_pos.y) == "hole" then
			local not_layer = areas[game.area].layers[current_layer + 1]
			if not_layer then
				local not_tile_pos = Vector2.new(
					(self.position.x - not_layer.pos_offset.x * 16 + not_layer.map_offset.x * 32 + not_layer.size.x * 16 - 16) // 32,
					(self.position.y - not_layer.pos_offset.y * 16 + not_layer.map_offset.y * 32 + not_layer.size.y * 16 - 16) // 32
				)
				
				self.state = "Falling"

				if get_tile(not_tile_pos.x, not_tile_pos.y) == "spikes" then
					sfx(61, (12 * 4)-1, -1, 1, 15)
				else
					sfx(60, (12 * 7)  , -1, 1, 15)
				end
				return
			end
			
			self.state = "Transitioning"
			return
		end
		
		local vector = get_joy_vector_cardinal()
		
		if vector.x ~= 0 or vector.y ~= 0 then
			self.direction = vector
		end
		
		if peek(0x13ffe) % areas[game.area].rows_per_beat == areas[game.area].rows_per_beat // 2 then
			if self.direction.x ~= 0 then
				self.flip = self.direction.x < 0 and 1 or 0
			end
			
			if self.direction.x == 1 or self.direction.x == -1 then self.spr_index = 262
			elseif self.direction.y == 1 or self.direction.y == -1 then self.spr_index = 256 end			
		
			if get_tile(tile_pos.x + self.direction.x, tile_pos.y + self.direction.y) == "ground"
			or get_tile(tile_pos.x + self.direction.x, tile_pos.y + self.direction.y) == "hole"
			or get_tile(tile_pos.x + self.direction.x, tile_pos.y + self.direction.y) == "spikes"
			or get_tile(tile_pos.x + self.direction.x, tile_pos.y + self.direction.y) == "lock" and player.keys_left <= 0 then
				self.state = "Moving"
			else
				self.direction.x = 0
				self.direction.y = 0
				self.state = "Moving"
			end
		end
	end

	if self.state == "Moving" then
		self.anim = self.anim + 2
		self.position.x = self.position.x + (2 * self.direction.x)
		self.position.y = self.position.y + (2 * self.direction.y)
		if self.anim == 32 then
			self.anim = 0
			self.state = "Idle"
			return
		end
	end

	if self.state == "Falling" then
		self.layer_falling_timer = self.layer_falling_timer + 1
		if self.layer_falling_timer == 32 then
			current_layer = current_layer + 1
			enter_new_layer()
			self.layer_falling_timer = 0
			self.state = "Idle"
			return
		end
	end

	if self.state == "Transitioning" then
		self.area_transition_timer = self.area_transition_timer + 1
		if self.area_transition_timer == 32 then
			self.area_transition_timer = 0
			enter_new_area()
			return
		end
	end
end

function player.render(self)
	local layer = areas[game.area].layers[current_layer]
	print(((self.position.x - layer.pos_offset.x * 16 + layer.map_offset.x * 32 + layer.size.x * 16 - 16) // 32).." "..((self.position.y - layer.pos_offset.y * 16 + layer.map_offset.y * 32 + layer.size.y * 16 - 16) // 32), 0, 8)
	local jump_height_offset = math.sin(self.anim/32*math.pi) * -8

	spr(self.spr_index                                           , 240/2 - self.size.x / 2, 136/2 - self.size.y / 2 + jump_height_offset - 8, 0, 1, self.flip, 0, 3, 2)
	spr(self.spr_index + 3 * (self.anim > 0 and 1 or 0 ) + (16*2), 240/2 - self.size.x / 2, 136/2 - self.size.y / 2 + jump_height_offset + 8, 0, 1, self.flip, 0, 3, 2)
end

function get_tile(x, y)
	local tiles = { -- id of top left 8x8 tile of the 32x32 tiles
		[0] = "wall",
		[4] = "ground",
		[08] = "spikes",
		[12] = "wall",
		[64] = "ground",
		[68] = "wall",
		[72] = "ground",
		[76] = "hole",
		[128] = "ground",
		[132] = "ground",
		[136] = "lock",
		[140] = "wall",
		
	}

	return tiles[mget(x * 4, y * 4)]
end

Button = {
		Up    = 0,
		Down  = 1,
		Left  = 2,
		Right = 3,
		A     = 4,
		B     = 5,
		C     = 6,
		D     = 7
	}

function get_joy_vector_cardinal()
	local x = 0
	local y = 0

	if btn(Button.Right) then
		x = 1
	elseif btn(Button.Left) then
		x = -1
	elseif btn(Button.Down) then
		y = 1
	elseif btn(Button.Up) then
		y = -1
	end

	return Vector2.new(x, y)
end

